import React, {useEffect, useState}  from 'react';

const Avis = (props) => {
    return (
        <div className="avis m-2">
            <div className="avisNote">
                <div className="d-flex align-items-end">
                    <span className="note">
                        {props.note}
                    </span>
                    <span className="noteText">
                        /5
                    </span>
                </div>
                <span className="avisEtoiles text-align-center">
                    ****
                </span>
            </div>
            <div className="d-flex flex-column jusitify-content-between ms-3">
                <div className="d-flex flex-column">
                    <span className="fw-bold">
                        {props.titre}
                    </span>
                    <span className="avisDate">
                        L{props.date} post√© par {props.user.user.first_name}
                    </span>
                </div>
                <div className="d-flex flex-column">
                    <p className="avisText">
                        {props.contenu}
                    </p>
                </div>
            </div>
        </div>
    );
}

export default Avis;
